.github-Project {
  display: flex;
  align-items: center;
  padding: 5px 10px;
  border-bottom: 1px solid transparent;
}
.github-Project-path {
  flex: 1;
  margin-left: 10px;
}
.github-Project-avatarBtn {
  height: 23px;
  width: 23px;
  padding: 0;
  border-radius: 0.125rem;
  background-color: #181d20;
  border: none;
}
.github-Project-avatar {
  width: 23px;
  height: 23px;
  border-radius: 0.125rem;
  color: transparent;
  overflow: hidden;
}
.github-Project-lock.btn {
  width: 40px;
  height: 20px;
  padding: 0;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: baseline;
  border: none;
  background-color: transparent;
  background-image: none;
}
.github-Project-lock.btn:active,
.github-Project-lock.btn:hover {
  background-color: transparent;
  background-image: none;
}
.github-Project .icon {
  padding: 0;
  margin: 0;
  line-height: 1em;
  fill: rgba(167, 173, 186, 0.65);
}
.github-Project .icon:hover {
  fill: #a7adba;
}
.github-Project .icon.icon-unlock {
  width: 21px;
  height: 17px;
  padding-left: 1px;
}
